def calculate_min_steps(n, k, l1, r1, l2, r2):
    if l1 >= l2:
        (l1, r1, l2, r2) = (l2, r2, l1, r1)
    if r1 < l2:
        blank = l2 - r1
        get = r2 - l1
        need = blank + get
        if k < get:
            return blank + k
        elif k <= n * get:
            return int(k / get) * need + min(k % get, blank) + k % get
        else:
            return n * need + (k - n * get) * 2
    else:
        get = max(r2, r1) - l1
        init = n * (min(r2, r1) - l2)
        if k <= init:
            return 0
        elif k <= n * get:
            return k - init
        else:
            return n * get - init + 2 * (k - n * get)

